import { useState, useEffect } from "react";
import * as XLSX from "xlsx";
import JurnalForm from "./components/JurnalForm";

function App() {
  const [jurnalList, setJurnalList] = useState([]);
  const [editIndex, setEditIndex] = useState(null);
  const [editData, setEditData] = useState(null);
  const [filterKelas, setFilterKelas] = useState(localStorage.getItem("filterKelas") || "");
  const [filterBulan, setFilterBulan] = useState(localStorage.getItem("filterBulan") || "");
  const [filterTahun, setFilterTahun] = useState(localStorage.getItem("filterTahun") || "");
  const [filterGuru, setFilterGuru] = useState(localStorage.getItem("filterGuru") || "");
  const [filterSubjek, setFilterSubjek] = useState(localStorage.getItem("filterSubjek") || "");

  useEffect(() => {
    const dataTersimpan = localStorage.getItem("jurnalList");
    if (dataTersimpan) {
      setJurnalList(JSON.parse(dataTersimpan));
    }
  }, []);

  useEffect(() => {
    localStorage.setItem("jurnalList", JSON.stringify(jurnalList));
  }, [jurnalList]);

  useEffect(() => {
    localStorage.setItem("filterKelas", filterKelas);
    localStorage.setItem("filterBulan", filterBulan);
    localStorage.setItem("filterTahun", filterTahun);
    localStorage.setItem("filterGuru", filterGuru);
    localStorage.setItem("filterSubjek", filterSubjek);
  }, [filterKelas, filterBulan, filterTahun, filterGuru, filterSubjek]);

  const tambahJurnal = (jurnalBaru) => {
    if (editIndex !== null) {
      const jurnalBaruList = [...jurnalList];
      jurnalBaruList[editIndex] = jurnalBaru;
      setJurnalList(jurnalBaruList);
      setEditIndex(null);
      setEditData(null);
    } else {
      setJurnalList([...jurnalList, jurnalBaru]);
    }
  };

  const hapusJurnal = (index) => {
    const jurnalBaru = jurnalList.filter((_, i) => i !== index);
    setJurnalList(jurnalBaru);
  };

  const editJurnal = (index) => {
    setEditIndex(index);
    setEditData(jurnalList[index]);
  };

  const filterJurnal = jurnalList.filter((jurnal) => (
    (filterKelas === "" || jurnal.kelas === filterKelas) &&
    (filterBulan === "" || jurnal.tanggal.slice(5, 7) === filterBulan) &&
    (filterTahun === "" || jurnal.tanggal.slice(0, 4) === filterTahun) &&
    (filterGuru === "" || jurnal.guru === filterGuru) &&
    (filterSubjek === "" || jurnal.subjek === filterSubjek)
  ));

  const eksporKeExcel = () => {
    const ws = XLSX.utils.json_to_sheet(filterJurnal);
    const wb = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(wb, ws, "Jurnal Kelas");
    XLSX.writeFile(wb, "Jurnal_Kelas.xlsx");
  };

  return (
    <div>
      <h1>📖 Jurnal Kelas</h1>
      <JurnalForm tambahJurnal={tambahJurnal} editData={editData} />

      <h2>Filter Jurnal</h2>
      <input placeholder="Kelas" value={filterKelas} onChange={(e) => setFilterKelas(e.target.value)} />
      <input placeholder="Bulan" value={filterBulan} onChange={(e) => setFilterBulan(e.target.value)} />
      <input placeholder="Tahun" value={filterTahun} onChange={(e) => setFilterTahun(e.target.value)} />
      <input placeholder="Guru" value={filterGuru} onChange={(e) => setFilterGuru(e.target.value)} />
      <input placeholder="Subjek" value={filterSubjek} onChange={(e) => setFilterSubjek(e.target.value)} />

      <h2>Daftar Jurnal</h2>
      <button onClick={eksporKeExcel} style={{ background: "green", color: "white", padding: "10px" }}>📥 Ekspor ke Excel</button>
      {filterJurnal.length === 0 ? (
        <p>Belum ada jurnal yang sesuai filter.</p>
      ) : (
        <table border="1" cellPadding="5" cellSpacing="0" style={{ width: "100%", textAlign: "left" }}>
          <thead>
            <tr>
              <th>Tanggal</th>
              <th>Kelas</th>
              <th>Guru</th>
              <th>Subjek</th>
              <th>Topik</th>
              <th>Kehadiran</th>
              <th>Keterangan</th>
            </tr>
          </thead>
          <tbody>
            {filterJurnal.map((jurnal, index) => (
              <tr key={index}>
                <td>{jurnal.tanggal}</td>
                <td>{jurnal.kelas}</td>
                <td>{jurnal.guru}</td>
                <td>{jurnal.subjek}</td>
                <td>{jurnal.topik}</td>
                <td>{jurnal.kehadiran}</td>
                <td>{jurnal.keterangan}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default App;
